import React from 'react';
import ReactDom from 'react-dom';

function Cards(props){
    console.log(props.imgSrc);
}

ReactDom.render(
    <>
    <Cards imgSrc = "abc.com"/>
    <p>Hello World!!!</p>
    </>
    ,document.getElementById('root')
)
